import React from 'react';
import siteLogo from '../Logo1.jpg';

const HeaderMenu = () => (
    <div className='HeaderBar'>
        <img src={siteLogo} alt='Taste of Hansung' />
        <span>성신여대입구</span>
        <span>한성대입구</span>
        <span>혜화</span>
    </div>
)

export default HeaderMenu;
